    "html": "<h1 id=\"sliceButton\">Slice Button</h1>\r\n<div class=\"myButton\">\r\n  <p>\r\n    To build a simple Slice Button you only need to use the \"slice.build\"\r\n    method, just like that you have a Slice Button that you can customize with a\r\n    value prop. The Button component automatically applies default values \r\n    and provides enhanced debugging capabilities through Static Props.\r\n  </p>\r\n</div>\r\n<div class=\"colorButton\">\r\n  <h2 id=\"customization\">Customization</h2>\r\n  <p>\r\n    You can also customize your Slice Button specifying its background color\r\n    with \"customColor.button\" and its font color with \"customColor.label\". \r\n    Static Props ensure that the customColor property is properly typed as an object \r\n    and defaults to null when not specified.\r\n  </p>\r\n</div>\r\n<div class=\"onClick\">\r\n  <h2 id=\"onClickCallback\">onClickCallback</h2>\r\n  <p>\r\n    At last but not least you can add a function to your button with the prop\r\n    \"onClickCallback\". The Static Props system types this callback as a function \r\n    and defaults to null, with automatic validation in development mode.\r\n  </p>\r\n</div>\r\n\r\n<h2 id=\"staticPropsOverview\">Static Props Integration</h2>\r\n<p>\r\n  The Button component leverages Static Props for improved developer experience:\r\n</p>\r\n<ul>\r\n  <li><strong>Automatic defaults:</strong> All props have sensible defaults applied automatically</li>\r\n  <li><strong>Type validation:</strong> Development-time warnings for incorrect prop types</li>\r\n  <li><strong>Enhanced debugging:</strong> Right-click any button to see detailed prop information</li>\r\n  <li><strong>Self-documenting:</strong> Props are clearly defined with types and defaults</li>\r\n</ul>\r\n\r\n<h3>Button Static Props Configuration:</h3>\r\n<pre><code>static props = {\r\n   value: { type: 'string', default: 'Button', required: false },\r\n   onClickCallback: { type: 'function', default: null },\r\n   customColor: { type: 'object', default: null },\r\n   icon: { type: 'object', default: null }\r\n};</code></pre>",
