    "css": ".slice_checkbox input {\r\n  position: absolute;\r\n  opacity: 0;\r\n  cursor: pointer;\r\n  height: 0;\r\n  width: 0;\r\n}\r\n\r\n.slice_checkbox_container {\r\n  width: fit-content;\r\n}\r\n.slice_checkbox {\r\n  display: flex;\r\n  align-items: center;\r\n  user-select: none;\r\n  margin-top: 25px;\r\n  margin-bottom: 25px;\r\n  position: relative;\r\n  user-select: none;\r\n}\r\n.checkbox_label {\r\n  margin: 5px;\r\n  font-family: var(--font-family);\r\n  color: var(--font-primary-color);\r\n}\r\n.checkmark {\r\n  position: relative;\r\n  top: 0;\r\n  left: 0;\r\n  height: 1.3em;\r\n  width: 1.3em;\r\n  background-color: var(--secondary-background-color);\r\n  border: var(--slice-border) solid var(--primary-color);\r\n  transition: all 0.3s;\r\n  border-radius: var(--border-radius-slice);\r\n  cursor: pointer;\r\n}\r\n.slice_checkbox input:checked ~ .checkmark {\r\n  border: var(--slice-border) solid var(--success-color);\r\n  background-color: var(--success-color);\r\n  animation: pop 0.5s;\r\n  animation-direction: alternate;\r\n}\r\n\r\n.checkmark:after {\r\n  content: \"\";\r\n  position: absolute;\r\n  display: none;\r\n}\r\n\r\n.slice_checkbox input:checked ~ .checkmark:after {\r\n  display: block;\r\n}\r\n\r\n.slice_checkbox .checkmark:after {\r\n  left: 0.45em;\r\n  top: 0.25em;\r\n  width: 0.25em;\r\n  height: 0.5em;\r\n  border: solid white;\r\n  border-width: 0 0.15em 0.15em 0;\r\n  transform: rotate(45deg);\r\n}\r\n.disabled {\r\n  border-color: var(--disabled-color);\r\n  background-color: var(--primary-color-shade);\r\n  color: var(--disabled-color);\r\n  cursor: not-allowed;\r\n}\r\n@keyframes pop {\r\n  0% {\r\n    transform: scale(1);\r\n  }\r\n\r\n  50% {\r\n    transform: scale(0.9);\r\n  }\r\n\r\n  100% {\r\n    transform: scale(1);\r\n  }\r\n}\r\n.checkbox_label {\r\n  margin-left: 5px;\r\n  font-family: var(--font-family);\r\n  color: var(--font-primary-color);\r\n}\r\n",
