    "html": "<div class=\"documentation-content multiroutedocumentation\">\n\n<div class=\"doc-title-bar\">\n  <h1 id=\"multiroute\">\n    <span class=\"doc-title-text\">MultiRoute</span>\n    <span class=\"copy-md-slot\" data-copy-md></span>\n  </h1>\n</div>\n<h2 id=\"overview\">Overview</h2>\n<p>MultiRoute renders multiple routes inside a container and caches component instances for performance. When a cached route is revisited, its <code>update()</code> method is called.</p>\n<h2 id=\"api-reference\">API Reference</h2>\n<div class=\"table-block\" data-block-id=\"doc-block-1\"></div>\n<h2 id=\"props\">Props</h2>\n<div class=\"table-block\" data-block-id=\"doc-block-2\"></div>\n<h2 id=\"usage-patterns\">Usage Patterns</h2>\n<div class=\"code-block\" data-block-id=\"doc-block-3\"></div>\n<h2 id=\"interactive-demo\">Interactive Demo</h2>\n<div class=\"multiRoute-demo\" data-demo=\"basic\"></div>\n<h2 id=\"caching-behavior\">Caching Behavior</h2>\n<div class=\"code-block\" data-block-id=\"doc-block-4\"></div>\n<h2 id=\"best-practices\">Best Practices</h2>\n<div class=\"callout callout-tip\">Use stable component names and consistent routes to maximize cache reuse.</div>\n<div class=\"callout callout-tip\">Implement <code>update()</code> in your routed components to refresh data when revisited.</div>\n<h2 id=\"gotchas\">Gotchas</h2>\n<div class=\"callout callout-warning\">MultiRoute caches by component name, not by path. Different paths using the same component share state.</div>\n</div>\n",
    "css": "slice-multiroutedocumentation h1 {\r\n  color: var(--font-primary-color);\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-multiroutedocumentation h2 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 40px;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-multiroutedocumentation h3 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 30px;\r\n  margin-bottom: 15px;\r\n}\r\n\r\nslice-multiroutedocumentation h4 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 25px;\r\n  margin-bottom: 10px;\r\n}\r\n\r\nslice-multiroutedocumentation p {\r\n  color: var(--font-secondary-color);\r\n  line-height: 1.6;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-multiroutedocumentation ul {\r\n  color: var(--font-secondary-color);\r\n  line-height: 1.8;\r\n  margin-left: 20px;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-multiroutedocumentation pre {\r\n  background-color: var(--secondary-background-color);\r\n  padding: 15px;\r\n  border-radius: 8px;\r\n  overflow-x: auto;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-multiroutedocumentation code {\r\n  font-family: 'Courier New', monospace;\r\n  color: var(--font-primary-color);\r\n  background-color: var(--secondary-background-color);\r\n  padding: 2px 6px;\r\n  border-radius: 4px;\r\n}\r\n\r\n.multiRouteContainer {\r\n  display: flex;\r\n  flex-direction: column;\r\n  gap: 20px;\r\n  margin-bottom: 30px;\r\n}\r\n\r\n.multiRouteExample {\r\n  border: 1px solid var(--primary-color-shade);\r\n  border-radius: 8px;\r\n  padding: 20px;\r\n  background-color: var(--secondary-background-color);\r\n  margin-bottom: 10px;\r\n  min-height: 100px;\r\n}\r\n\r\n.static-props-example {\r\n  margin-top: 20px;\r\n}\r\n\r\n.route-info {\r\n  margin-top: 10px;\r\n  padding: 15px;\r\n  background-color: var(--tertiary-background-color);\r\n  border-radius: 6px;\r\n  border-left: 4px solid var(--primary-color);\r\n}\r\n\r\n.route-info strong {\r\n  color: var(--primary-color);\r\n}\r\n\r\n.cache-status {\r\n  display: inline-block;\r\n  padding: 4px 8px;\r\n  border-radius: 4px;\r\n  font-size: 0.85em;\r\n  font-weight: 600;\r\n  margin-left: 8px;\r\n}\r\n\r\n.cache-status.cached {\r\n  background-color: var(--success-color);\r\n  color: white;\r\n}\r\n\r\n.cache-status.new {\r\n  background-color: var(--primary-color);\r\n  color: white;\r\n}\r\n\r\n/* Estilos para botones de navegación */\r\n.nav-buttons-container {\r\n  display: flex;\r\n  gap: 10px;\r\n  margin-bottom: 20px;\r\n  flex-wrap: wrap;\r\n  padding: 15px;\r\n  background-color: var(--tertiary-background-color);\r\n  border-radius: 8px;\r\n}\r\n\r\n.nav-button-active {\r\n  background-color: var(--secondary-color) !important;\r\n  border-color: var(--secondary-color) !important;\r\n}\r\n\r\n@media only screen and (max-width: 770px) {\r\n  slice-multiroutedocumentation {\r\n    padding: 10px;\r\n  }\r\n  \r\n  .multiRouteExample {\r\n    padding: 10px;\r\n  }\r\n  \r\n  .nav-buttons-container {\r\n    padding: 10px;\r\n  }\r\n}",
