    "html": "<header class=\"slice_nav_header\">\r\n  <a class=\"logo_container\"></a>\r\n  <nav class=\"slice_nav_bar\">\r\n    <div class=\"nav_bar_menu\"></div>\r\n    <div class=\"nav_bar_buttons\"></div>\r\n    <div class=\"mobile_close_menu\">\r\n      <svg\r\n        class=\"w-6 h-6 text-gray-800 dark:text-white\"\r\n        aria-hidden=\"true\"\r\n        xmlns=\"http://www.w3.org/2000/svg\"\r\n        width=\"24\"\r\n        height=\"24\"\r\n        fill=\"none\"\r\n        viewBox=\"0 0 24 24\"\r\n      >\r\n        <path\r\n          stroke=\"var(--primary-color-contrast)\"\r\n          stroke-linecap=\"round\"\r\n          stroke-linejoin=\"round\"\r\n          stroke-width=\"2\"\r\n          d=\"M6 18 17.94 6M18 18 6.06 6\"\r\n        />\r\n      </svg>\r\n    </div>\r\n  </nav>\r\n  <div class=\"mobile_menu_button\">\r\n    <svg\r\n      class=\"w-6 h-6 text-gray-800 dark:text-white\"\r\n      aria-hidden=\"true\"\r\n      xmlns=\"http://www.w3.org/2000/svg\"\r\n      width=\"24\"\r\n      height=\"24\"\r\n      fill=\"none\"\r\n      viewBox=\"0 0 24 24\"\r\n    >\r\n      <path\r\n        stroke=\"var(--primary-color-contrast)\"\r\n        stroke-linecap=\"round\"\r\n        stroke-width=\"3\"\r\n        d=\"M12 6h.01M12 12h.01M12 18h.01\"\r\n      />\r\n    </svg>\r\n  </div>\r\n</header>\r\n",
    "css": ".slice_nav_header {\r\n  font-family: var(--font-family);\r\n  width: 100%;\r\n  z-index: 1;\r\n  box-shadow: 0px 0px 10px #00000050;\r\n  background-color: var(--primary-color);\r\n  display: flex;\r\n  justify-content: space-around;\r\n  align-items: center;\r\n}\r\n.direction-row-reverse {\r\n  flex-direction: row-reverse;\r\n}\r\n.nav_bar_fixed {\r\n  z-index: 100;\r\n  width: 100%;\r\n  left: 0;\r\n  top: 0;\r\n  position: fixed;\r\n}\r\n.slice_nav_bar {\r\n  transition: transform 0.3s ease;\r\n  width: 100%;\r\n  justify-content: center;\r\n  display: flex;\r\n  align-items: center;\r\n  left: 0;\r\n  top: 0;\r\n}\r\n.nav_bar_menu {\r\n  width: 100%;\r\n  overflow-y: hidden;\r\n  overflow-x: scroll;\r\n  display: flex;\r\n  align-items: center;\r\n  justify-content: center;\r\n  list-style: none;\r\n}\r\n.slice_nav_header .item {\r\n  cursor: pointer;\r\n  font-weight: bold;\r\n  text-decoration: none;\r\n  color: var(--primary-color-contrast);\r\n  border-radius: var(--border-radius-slice);\r\n}\r\n.anim-item {\r\n  position: absolute;\r\n  top: 100%;\r\n  left: 50%;\r\n  width: 0%;\r\n  height: 2.5px;\r\n  border-radius: 5px;\r\n  background-color: var(--primary-color-contrast);\r\n  transition: width 0.3s ease, left 0.3s ease;\r\n}\r\n.slice_nav_header li {\r\n  margin: 25px;\r\n  display: flex;\r\n  justify-content: center;\r\n  position: relative;\r\n}\r\n\r\n.slice_nav_header li:hover .anim-item {\r\n  width: 100%;\r\n  left: 0;\r\n}\r\n.slice_nav_header .logo_container {\r\n  padding: 10px;\r\n}\r\n.logo_container img {\r\n  pointer-events: none;\r\n  user-select: none;\r\n  max-height: 50px;\r\n  max-width: 200px;\r\n}\r\n.nav_bar_buttons {\r\n  justify-content: flex-end;\r\n  display: flex;\r\n}\r\n\r\n.mobile_menu_button,\r\n.mobile_close_menu {\r\n  visibility: hidden;\r\n  position: absolute;\r\n  right: 0px;\r\n  margin-right: 25px;\r\n}\r\n.mobile_close_menu {\r\n  top: 25px;\r\n}\r\n@media only screen and (max-width: 1020px) {\r\n  .slice_nav_bar {\r\n    z-index: 1;\r\n    list-style: none;\r\n    width: 100%;\r\n    height: 100%;\r\n    position: fixed;\r\n    top: 0;\r\n    left: 0;\r\n    display: flex;\r\n    justify-content: center;\r\n    align-items: center;\r\n    flex-direction: column;\r\n    background-color: var(--primary-color);\r\n    transform: translateX(100%);\r\n  }\r\n  .nav_bar_menu,\r\n  .nav_bar_buttons {\r\n    flex-direction: column;\r\n  }\r\n  .mobile_menu_button,\r\n  .mobile_close_menu {\r\n    visibility: visible;\r\n  }\r\n}\r\n",
