    "html": "<div class=\"slice_dropdown\">\r\n  <label class=\"slice_dropdown_label\"></label>\r\n  <div class=\"caret\"></div>\r\n</div>\r\n<div class=\"slice_dropbox\"></div>\r\n",
    "css": ".slice_dropdown_label {\r\n  cursor: pointer;\r\n}\r\n.slice_dropdown {\r\n  cursor: pointer;\r\n  user-select: none;\r\n  display: flex;\r\n  justify-content: center;\r\n  display: flex;\r\n  border-radius: var(--border-radius-slice);\r\n  border: var(--slice-border) solid var(--primary-color);\r\n  align-items: center;\r\n}\r\n.slice_dropdown .caret {\r\n  margin-left: 10px;\r\n  border-top-color: var(--primary-color-contrast);\r\n}\r\n.slice_dropbox {\r\n  display: flex;\r\n  flex-direction: column;\r\n  border: var(--slice-border) solid var(--primary-color);\r\n  list-style: none;\r\n  font-family: var(--font-family);\r\n  visibility: hidden;\r\n  overflow: hidden;\r\n  position: absolute;\r\n  opacity: 0;\r\n  transition: 0s, opacity 0.3s;\r\n  top: 100%;\r\n  z-index: 1;\r\n  background-color: var(--primary-color);\r\n  border-radius: var(--border-radius-slice);\r\n  box-shadow: 0 0 10px 0 #00000050;\r\n}\r\n.slice_dropbox_open {\r\n  overflow-y: scroll;\r\n  min-height: min-content;\r\n  max-height: 200px;\r\n  visibility: visible;\r\n  opacity: 1;\r\n}\r\n.slice_dropbox_open::-webkit-scrollbar {\r\n  width: 5px;\r\n}\r\n.slice_dropbox_open::-webkit-scrollbar-thumb {\r\n  background: var(--secondary-color);\r\n  border-radius: var(--border-radius-slice);\r\n}\r\n.slice_dropbox {\r\n  width: 100%;\r\n}\r\n.slice_dropbox_open div a {\r\n  text-decoration: none;\r\n  color: var(--primary-color-contrast);\r\n  width: 100%;\r\n}\r\n.slice_dropbox_open div {\r\n  width: 100%;\r\n  padding: 5px;\r\n}\r\n",
