    "css": "/* Container principal - ahora sin position hardcoded */\r\n.full-screen {\r\n  width: 100%;\r\n  height: 100%;\r\n  /* position se maneja desde JavaScript */\r\n  inset: 0; /* top: 0, right: 0, bottom: 0, left: 0 */\r\n  background: rgba(90, 90, 90, 0.5);\r\n  z-index: 500;\r\n  display: flex;\r\n  justify-content: center;\r\n  align-items: center;\r\n}\r\n\r\n.pizza-container {\r\n  width: 100%;\r\n  height: 100%;\r\n  display: flex;\r\n  justify-content: center;\r\n  align-items: center;\r\n  position: relative;\r\n  z-index: 501;\r\n}\r\n\r\n@keyframes spin {\r\n  from {\r\n    transform: rotate(0deg);\r\n  }\r\n\r\n  to {\r\n    transform: rotate(360deg);\r\n  }\r\n}\r\n\r\n@keyframes fade {\r\n  0% {\r\n    opacity: 0;\r\n  }\r\n\r\n  50% {\r\n    opacity: 1;\r\n  }\r\n\r\n  100% {\r\n    opacity: 0;\r\n  }\r\n}\r\n\r\n.slice_logo {\r\n  animation: spin 0.1s linear infinite;\r\n  height: 50px;\r\n  width: 50px;\r\n\r\n  path {\r\n    fill: var(--primary-color);\r\n  }\r\n}",
