    "html": "<h1 id=\"sliceDetails\">Slice Details</h1>\r\n<div class=\"myDetails\">\r\n  <p>\r\n    The Details component provides an expandable/collapsible container (accordion) \r\n    perfect for showing additional information on demand. It automatically handles \r\n    animation and state management. The component uses Static Props for automatic \r\n    defaults and enhanced debugging.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"basicDetails\">\r\n  <h2 id=\"basicUsage\">Basic Usage</h2>\r\n  <p>\r\n    Create a simple Details component with a title and descriptive text. \r\n    Click on the component to expand and collapse it. The animation is handled \r\n    automatically with smooth transitions.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"withContentDetails\">\r\n  <h2 id=\"withContent\">With Additional Content</h2>\r\n  <p>\r\n    Use the <code>addDetail()</code> method to add custom content inside the \r\n    Details component. You can add any HTML element or Slice component, making \r\n    it perfect for complex nested content.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"multipleContentDetails\">\r\n  <h2 id=\"multipleContent\">Multiple Content Items</h2>\r\n  <p>\r\n    Add multiple elements to a single Details component to create rich, expandable \r\n    sections. Great for documentation, FAQs, or any content that benefits from \r\n    progressive disclosure.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"nestedDetails\">\r\n  <h2 id=\"nestedDetails\">Nested Details</h2>\r\n  <p>\r\n    Details components can be nested inside each other to create hierarchical \r\n    expandable sections. Perfect for complex documentation or multi-level navigation.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"codeExampleDetails\">\r\n  <h2 id=\"withCodeExample\">With Code Examples</h2>\r\n  <p>\r\n    Combine Details with CodeVisualizer to create interactive code documentation. \r\n    This is particularly useful for API references or tutorial content where you \r\n    want to show code examples on demand.\r\n  </p>\r\n</div>\r\n\r\n<h2 id=\"staticPropsOverview\">Static Props Integration</h2>\r\n<p>\r\n  The Details component leverages Static Props for improved developer experience:\r\n</p>\r\n<ul>\r\n  <li><strong>Automatic defaults:</strong> All props have sensible defaults applied automatically</li>\r\n  <li><strong>Type validation:</strong> Development-time warnings for incorrect prop types</li>\r\n  <li><strong>Enhanced debugging:</strong> Right-click any Details to see detailed prop information</li>\r\n  <li><strong>Self-documenting:</strong> Props are clearly defined with types and defaults</li>\r\n  <li><strong>Smooth animations:</strong> Built-in expand/collapse animations with height transitions</li>\r\n</ul>\r\n\r\n<h3 id=\"staticPropsConfig\">Details Static Props Configuration:</h3>\r\n<div class=\"static-props-example\"></div>",
    "css": "slice-detailsdocumentation h1 {\r\n  color: var(--font-primary-color);\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-detailsdocumentation h2 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 40px;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-detailsdocumentation h3 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 30px;\r\n  margin-bottom: 15px;\r\n}\r\n\r\nslice-detailsdocumentation h4 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 25px;\r\n  margin-bottom: 10px;\r\n}\r\n\r\nslice-detailsdocumentation p {\r\n  color: var(--font-secondary-color);\r\n  line-height: 1.6;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-detailsdocumentation ul {\r\n  color: var(--font-secondary-color);\r\n  line-height: 1.8;\r\n  margin-left: 20px;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-detailsdocumentation code {\r\n  font-family: 'Courier New', monospace;\r\n  color: var(--primary-color);\r\n  background-color: var(--secondary-background-color);\r\n  padding: 2px 6px;\r\n  border-radius: 4px;\r\n}\r\n\r\n.detailsContainer {\r\n  display: flex;\r\n  flex-direction: column;\r\n  gap: 20px;\r\n  margin-bottom: 30px;\r\n}\r\n\r\n.detailsExample {\r\n  margin-bottom: 10px;\r\n}\r\n\r\n.static-props-example {\r\n  margin-top: 20px;\r\n}\r\n\r\n.example-note {\r\n  margin-top: 15px;\r\n  padding: 15px;\r\n  background-color: var(--tertiary-background-color);\r\n  border-radius: 6px;\r\n  border-left: 4px solid var(--primary-color);\r\n  color: var(--font-secondary-color);\r\n}\r\n\r\n.example-note strong {\r\n  color: var(--primary-color);\r\n}\r\n\r\n@media only screen and (max-width: 770px) {\r\n  slice-detailsdocumentation {\r\n    padding: 10px;\r\n  }\r\n}",
