    "html": "   <div class=\"treeviewdocumentation\">\r\n      <h1>TreeView Component</h1>\r\n      <p>\r\n         The TreeView component provides a hierarchical navigation structure with expandable/collapsible nodes.\r\n         Perfect for creating nested menus, file structures, and multi-level navigation systems.\r\n      </p>\r\n\r\n      <h2>Basic TreeView</h2>\r\n      <p>\r\n         A simple TreeView with flat items. Each item can have a value and an optional path for navigation.\r\n      </p>\r\n      <div class=\"treeviewContainer\">\r\n         <div class=\"treeviewExample\">\r\n            <div class=\"basicTreeView\"></div>\r\n         </div>\r\n      </div>\r\n\r\n      <h2>Hierarchical Structure</h2>\r\n      <p>\r\n         Create nested menu structures by adding items arrays to parent items. Parent items (without path) \r\n         automatically become expandable/collapsible nodes.\r\n      </p>\r\n      <div class=\"treeviewContainer\">\r\n         <div class=\"treeviewExample\">\r\n            <div class=\"hierarchicalTreeView\"></div>\r\n         </div>\r\n      </div>\r\n\r\n      <h2>Navigation TreeView</h2>\r\n      <p>\r\n         A more complex example showing deep nesting with multiple levels. Perfect for documentation sites\r\n         or application menus with categories and subcategories.\r\n      </p>\r\n      <div class=\"treeviewContainer\">\r\n         <div class=\"treeviewExample\">\r\n            <div class=\"navigationTreeView\"></div>\r\n         </div>\r\n      </div>\r\n\r\n      <h2>Static Props Configuration</h2>\r\n      <p>\r\n         The TreeView component uses Static Props for automatic prop validation and default values.\r\n         This ensures consistent behavior and reduces boilerplate code.\r\n      </p>\r\n      <div class=\"static-props-example\"></div>\r\n\r\n      <h2>TreeItem Component</h2>\r\n      <p>\r\n         TreeView is composed of TreeItem components. Each TreeItem can contain nested TreeItems,\r\n         creating the hierarchical structure. Understanding TreeItem props helps you build complex\r\n         navigation structures.\r\n      </p>\r\n      <div class=\"treeitem-props-example\"></div>\r\n\r\n    \r\n      <h2>Key Features</h2>\r\n      <ul>\r\n         <li><strong>Automatic State Persistence:</strong> TreeView remembers which nodes are expanded/collapsed</li>\r\n         <li><strong>Smooth Animations:</strong> Elegant expand/collapse transitions built-in</li>\r\n         <li><strong>Flexible Navigation:</strong> Use with slice.router or custom callbacks</li>\r\n         <li><strong>Unlimited Nesting:</strong> Create structures as deep as needed</li>\r\n         <li><strong>Smart Click Handling:</strong> Items with path navigate, parents toggle expansion</li>\r\n         <li><strong>Static Props:</strong> Automatic validation and defaults for reliable behavior</li>\r\n      </ul>\r\n\r\n      <h2>Tips & Best Practices</h2>\r\n      <ul>\r\n         <li>Use descriptive value properties for better accessibility and state management</li>\r\n         <li>Reserve path property only for leaf nodes (items without children)</li>\r\n         <li>Keep nesting levels reasonable (3-4 levels max) for better UX</li>\r\n         <li>Use onClickCallback for consistent navigation across all items</li>\r\n         <li>Group related items logically for intuitive navigation</li>\r\n         <li>Consider mobile viewports when designing deep tree structures</li>\r\n      </ul>\r\n   </div>\r\n",
    "css": "slice-treeviewdocumentation {\r\n  display: block;\r\n  padding: 40px;\r\n  max-width: 1200px;\r\n  margin: 0 auto;\r\n}\r\n\r\nslice-treeviewdocumentation h1 {\r\n  color: var(--font-primary-color);\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-treeviewdocumentation h2 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 40px;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-treeviewdocumentation h3 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 30px;\r\n  margin-bottom: 15px;\r\n}\r\n\r\nslice-treeviewdocumentation h4 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 25px;\r\n  margin-bottom: 10px;\r\n}\r\n\r\nslice-treeviewdocumentation p {\r\n  color: var(--font-secondary-color);\r\n  line-height: 1.6;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-treeviewdocumentation ul {\r\n  color: var(--font-secondary-color);\r\n  line-height: 1.8;\r\n  margin-left: 20px;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-treeviewdocumentation pre {\r\n  background-color: var(--secondary-background-color);\r\n  padding: 15px;\r\n  border-radius: 8px;\r\n  overflow-x: auto;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-treeviewdocumentation code {\r\n  font-family: 'Courier New', monospace;\r\n  color: var(--font-primary-color);\r\n}\r\n\r\nslice-treeviewdocumentation .treeviewContainer {\r\n  display: flex;\r\n  flex-direction: column;\r\n  gap: 20px;\r\n  margin-bottom: 30px;\r\n}\r\n\r\nslice-treeviewdocumentation .treeviewExample {\r\n  border: 1px solid var(--primary-color-shade);\r\n  border-radius: 8px;\r\n  padding: 20px;\r\n  background-color: var(--secondary-background-color);\r\n  margin-bottom: 10px;\r\n}\r\n\r\nslice-treeviewdocumentation .treeviewExample slice-treeview {\r\n  margin-bottom: 20px;\r\n  max-height: 400px;\r\n  overflow-y: auto;\r\n  border: 1px solid var(--primary-color-shade);\r\n  border-radius: 4px;\r\n  padding: 10px;\r\n}\r\n\r\nslice-treeviewdocumentation .static-props-example {\r\n  margin-top: 20px;\r\n  padding: 20px;\r\n  background-color: var(--secondary-background-color);\r\n  border-radius: 8px;\r\n}\r\n\r\nslice-treeviewdocumentation .static-props-example h2 {\r\n  margin-top: 0;\r\n}\r\n\r\nslice-treeviewdocumentation .static-props-example h4 {\r\n  margin-top: 30px;\r\n}\r\n\r\nslice-treeviewdocumentation .static-props-example p {\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-treeviewdocumentation .treeitem-props-example {\r\n  margin-top: 20px;\r\n  padding: 20px;\r\n  background-color: var(--secondary-background-color);\r\n  border-radius: 8px;\r\n}\r\n\r\nslice-treeviewdocumentation .treeitem-props-example h4 {\r\n  margin-top: 30px;\r\n}\r\n\r\n@media only screen and (max-width: 770px) {\r\n  slice-treeviewdocumentation {\r\n    padding: 10px;\r\n  }\r\n  \r\n  slice-treeviewdocumentation .treeviewExample {\r\n    padding: 10px;\r\n  }\r\n\r\n  slice-treeviewdocumentation .treeviewExample slice-treeview {\r\n    max-height: 300px;\r\n  }\r\n\r\n  slice-treeviewdocumentation .static-props-example,\r\n  slice-treeviewdocumentation .treeitem-props-example {\r\n    padding: 15px;\r\n  }\r\n}",
