    "html": "<h1 id=\"sliceSelect\">Slice Select</h1>\r\n<div class=\"mySelect\">\r\n  <p>\r\n    The Select component provides a customizable dropdown selector with support for single \r\n    and multiple selection modes. It automatically handles option rendering and selection state.\r\n    The component uses Static Props for automatic defaults and enhanced debugging.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"basicSelect\">\r\n  <h2 id=\"basicUsage\">Basic Usage</h2>\r\n  <p>\r\n    Create a simple Select with an array of options. Each option is an object where you can \r\n    specify which property to display using the visibleProp. By default, it looks for a 'text' \r\n    property in each option object.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"labelSelect\">\r\n  <h2 id=\"withLabel\">With Label</h2>\r\n  <p>\r\n    Add a label (placeholder) to your Select to indicate what the user should select. \r\n    The label disappears when an option is selected and reappears when cleared.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"multipleSelect\">\r\n  <h2 id=\"multipleSelection\">Multiple Selection</h2>\r\n  <p>\r\n    Enable multiple selection mode to allow users to select more than one option. \r\n    Selected options are displayed as a comma-separated list. Static Props ensure \r\n    the multiple property is properly typed as boolean with a default of false.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"callbackSelect\">\r\n  <h2 id=\"onOptionSelect\">onOptionSelect Callback</h2>\r\n  <p>\r\n    Use the onOptionSelect callback to execute custom logic when an option is selected \r\n    or deselected. This is perfect for form validation, API calls, or updating other \r\n    components based on the selection.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"visiblePropSelect\">\r\n  <h2 id=\"visibleProp\">Custom Visible Property</h2>\r\n  <p>\r\n    Use the visibleProp to specify which property of your option objects should be \r\n    displayed in the dropdown. This allows you to work with complex data structures \r\n    while displaying user-friendly labels.\r\n  </p>\r\n</div>\r\n\r\n<div class=\"disabledSelect\">\r\n  <h2 id=\"disabledState\">Disabled State</h2>\r\n  <p>\r\n    Set the disabled property to true to prevent user interaction with the Select. \r\n    This is useful for readonly forms or conditional form fields.\r\n  </p>\r\n</div>\r\n\r\n<h2 id=\"staticPropsOverview\">Static Props Integration</h2>\r\n<p>\r\n  The Select component leverages Static Props for improved developer experience:\r\n</p>\r\n<ul>\r\n  <li><strong>Automatic defaults:</strong> All props have sensible defaults applied automatically</li>\r\n  <li><strong>Type validation:</strong> Development-time warnings for incorrect prop types</li>\r\n  <li><strong>Enhanced debugging:</strong> Right-click any select to see detailed prop information</li>\r\n  <li><strong>Self-documenting:</strong> Props are clearly defined with types and defaults</li>\r\n</ul>\r\n\r\n<h3 id=\"staticPropsConfig\">Select Static Props Configuration:</h3>\r\n<div class=\"static-props-example\"></div>",
    "css": "slice-selectdocumentation h1 {\r\n  color: var(--font-primary-color);\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-selectdocumentation h2 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 40px;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-selectdocumentation h3 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 30px;\r\n  margin-bottom: 15px;\r\n}\r\n\r\nslice-selectdocumentation h4 {\r\n  color: var(--font-primary-color);\r\n  margin-top: 25px;\r\n  margin-bottom: 10px;\r\n}\r\n\r\nslice-selectdocumentation p {\r\n  color: var(--font-secondary-color);\r\n  line-height: 1.6;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-selectdocumentation ul {\r\n  color: var(--font-secondary-color);\r\n  line-height: 1.8;\r\n  margin-left: 20px;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-selectdocumentation pre {\r\n  background-color: var(--secondary-background-color);\r\n  padding: 15px;\r\n  border-radius: 8px;\r\n  overflow-x: auto;\r\n  margin-bottom: 20px;\r\n}\r\n\r\nslice-selectdocumentation code {\r\n  font-family: 'Courier New', monospace;\r\n  color: var(--font-primary-color);\r\n}\r\n\r\n.selectContainer {\r\n  display: flex;\r\n  flex-direction: column;\r\n  gap: 20px;\r\n  margin-bottom: 30px;\r\n}\r\n\r\n.selectExample {\r\n  border: 1px solid var(--primary-color-shade);\r\n  border-radius: 8px;\r\n  padding: 20px;\r\n  background-color: var(--secondary-background-color);\r\n  margin-bottom: 10px;\r\n  display: flex;\r\n  align-items: center;\r\n  justify-content: center;\r\n  min-height: 80px;\r\n}\r\n\r\n.static-props-example {\r\n  margin-top: 20px;\r\n}\r\n\r\n.selectedValueDisplay {\r\n  margin-top: 10px;\r\n  padding: 10px;\r\n  background-color: var(--tertiary-background-color);\r\n  border-radius: 6px;\r\n  color: var(--font-primary-color);\r\n  font-family: monospace;\r\n  font-size: 0.9em;\r\n}\r\n\r\n@media only screen and (max-width: 770px) {\r\n  slice-selectdocumentation {\r\n    padding: 10px;\r\n  }\r\n  \r\n  .selectExample {\r\n    padding: 10px;\r\n  }\r\n}",
